main: 	lui $t0, 0x1001
	lui $t8, 0x1003
	jal load
#NAVIO
 	lui $t0, 0x1001 	#cenario exibido
	lui $t7,0x1002		#end memoria onde estao guardados os personagens atraves do mapa de bits
	addi $t7,$t7, -32768	#512x256, proporcao 4x4
				#armazenado em 0x10010000 + 32768(0x10010000), ou seja, 0x10020000-32768
	lui $t8, 0x1003 	#cenario estatico para substituirmos
	addi $t2, $0, 24	#qntd de bits que existem a partir de 0x10018000 para mostrar o navio
	addi $t4, $0, 6		#qntd de colunas passadas para mostrar o navio
	jal navio
#PEIXE DO MAL	
	lui $t0, 0x1001 	#cenario mostrado
	lui $t7, 0x1002 	#end memoria onde estao guardados os personagens atraves do mapa de bits
	addi $t7, $t7, -32720 	#32768-48=32720       12*4=48
	
	lui $t8, 0x1003 	
	addi $t2, $0, 12	#total bits
	addi $t4, $0, 2		#total colunas peixe 
	jal peixe
	
fim: 	addi $2, $0, 10 	#fim
	syscall

navio: 	beq $t4, $0, plinha 	
	lw $t3, 0($t7)
	beq $t3, 0x000104b5, prox #cor do cenario 0x000104b5
	sw $t3, 12900($t0) 	#local pra ver o navio
	addi $t0, $t0, 4
	addi $t8, $t8, 4
	addi $t7, $t7, 4
	addi $t2, $t2, -1
	addi $t4, $t4, -1
	beq $t2, $0, voltar
	j navio
	
prox: 	addi $t0, $t0, 4
	addi $t8, $t8, 4
	addi $t7, $t7, 4
	addi $t2, $t2, -1
	addi $t4, $t4, -1
	j navio
	
plinha: addi $t4, $0, 6
	addi $t0, $t0, 488 	#512-(6*4)
	addi $t8, $t8, 488
	j navio
	
voltar: jr $31

peixe: 	beq $t4, $0, plinha2
	lw $t3, 0($t7)
	beq $t3, 0x000104b5, proxpx 	#cor do cenario
	sw $t3, 20832($t0) 	
 	addi $t0, $t0, 4
	addi $t8, $t8, 4
	addi $t7, $t7, 4
	addi $t2, $t2, -1
	addi $t4, $t4, -1
	beq $t2, $0, voltarpx
	j peixe
	
proxpx:	addi $t0, $t0, 4
	addi $t8, $t8, 4
	addi $t7, $t7, 4
	addi $t2, $t2, -1
	addi $t4, $t4, -1
	beq $t2, $0, voltarpx
	j peixe
	
plinha2: addi $t4, $t0, 2
	addi $t0, $t0, 504 	#512-2*4=504
	addi $t8, $t8, 504
	j peixe
	
voltarpx: jr $31 		
	
load: 	lw $t1, 0($t0)	
	sw $t1, 0($t8)	
	sw $t1, 0($t0)	
	addi $t0, $t0, 4
	addi $t8, $t8, 4 
	addi $t2, $t2, 1
	bne $t2, 8192, load
	jr $31
	
	
	
	